function App() {
  return (
   <div>
      <div style={{width:'100%',display:'flex',justifyContent:'space-between'}}>
          <div style={{width:'60px',height:'60px'}}>
           <a>{/* <button> */}
                <React.Fragment>
               <img alt="githubpath" src='src\static\githubpath.jpg' style={{width:'60px',height:'60px'}}/>
               </React.Fragment>
              {/* </button> */}
           </a>
          </div>
          <button>
          <OnlyCartHeader productsQuans={2}/>
          </button>
      </div>
      <div style={{display:'flex',width:'1200px',margin:'0 auto'}}>
        <SizeContainer/>
        <FoundContainer/>
       </div>
    </div>
  );
}

export default App;
